import intro from '../css/intro.css';

class Intro extends React.Component {




  render() {
    return(
      <div className="container">

        <div className="background-image">
          <div className="message-border">
            <span className="message">
              Testing
            </span>
          </div>
        </div>
        <div>
          lorem10
        </div>
      </div>
    );
  }
}

export default Intro;
